import React, { Component, Fragment } from 'react';
import Navbar from './components/Navbar/index';
import Home from './components/Home';

export class App extends Component {
  render() {
    return (
      <Fragment>
        <Navbar />
        <Home />
      </Fragment>
    );
  }
}

export default App;
